from tensorflow import kerasimport config as configcfg = config.cfgdef mobilenetv2(input_shape=(224, 224, 3), classes_num=len(cfg["labels_list"])):    base_model = keras.applications.MobileNetV2(        weights='imagenet',        input_shape=input_shape,        include_top=False)    base_model.trainable = False    inputs = keras.Input(input_shape)    x = base_model(inputs, training=False)    x = keras.layers.GlobalAveragePooling2D()(x)    x = keras.layers.Dropout(0.2)(x)    outputs = keras.layers.Dense(classes_num, activation='softmax')(x)    model = keras.Model(inputs, outputs)    return base_model, model